import '../css/login.css';

export default function Login() {
   return (
      <div id="page">
         <div id="title">
            <h1>Drip Me Out</h1>
         </div>
         <div id="login">
            <p>E-mail</p>
            <p>Password</p>
         </div>
      </div>
   )
}
